 INTO WORD VALUES('51','3','앗, 넵!!!','이미 알고 있었지만 하기 싫어서 놔둔 일을 누군가 발견했을 때 처음 들은 것처럼 반응할 때 쓰는 말','A : 이 주임, 차장님 출장 결재 건 오늘까지인 거 알지? / B : 앗, 넵!!!',to_date('2019-05-02 15:06:24','yyyy-mm-dd hh24:mi:ss'),'https://media0.giphy.com/media/eKDp7xvUdbCrC/giphy.webp?cid=790b76113db317e45d8fe8896d0979d06226958a61db5de6&rid=giphy.webp')
 INTO WORD VALUES('52','4','취존','취향 존중의 줄임말. 내가 좋아하는 것을 남이 싫어하거나, 내가 싫어하는 것을 남이 싫어하는 것을 존중할 때 혹은 존중받지 못할 때 사용함.','오이를 좋아하는 너의 취향... 취존한다.',to_date('2019-03-03 13:00:24','yyyy-mm-dd hh24:mi:ss'),'https://media2.giphy.com/media/13sIcCcGwQszU4/200.gif?cid=765b7e61a12fdae81a5b6645ade99c352e5991ea59101f24&rid=200.gif')
