 INTO WORD VALUES('54','5','개이득','무척 이득을 봤다는 말로, 무척을 뜻하는 개와 이득이 합쳐진 말이다.','어제 길가다가 만 원을 주웠다. 개이득~',to_date('2019-12-01 11:01:15','yyyy-mm-dd hh24:mi:ss'),'')
