 INTO WORD VALUES('56','8','뜨또','미국의 가수 저스틴 비버를 말함. 뜨또를 뒤집으면 비버가 되는 것에서 유래했다.','뜨또는 바지를 참 잘 내려입는다.',to_date('2019-02-01 8:09:02','yyyy-mm-dd hh24:mi:ss'),'https://media0.giphy.com/media/YlNQ30dyJ8hjvoPYhz/200.gif?cid=765b7e618dcb34181648b947b34b7151a5c49c8ada546163&rid=200.gif')
