 INTO WORD VALUES('58','10','그린라이트','본래 미국에서 쓰는 관용 표현으로, 신호등에서 초록불이 켜지면 통행이 된다는 뜻과 같이 안전, 통과, 긍정을 허락하는 말','어제 걔가 나랑 밥 먹자는데 이거 그린라이트임? / 그린라이트 맞음. 첫째 유치원이나 먼저 알아봐.',to_date('2019-05-06 9:01:02','yyyy-mm-dd hh24:mi:ss'),'https://media2.giphy.com/media/5jj38to9r6a88/giphy.webp?cid=790b761150b30d7c3528ca4850aff9f500daf027c716f5de&rid=giphy.webp')
