 INTO WORD VALUES('63','8','먹튀','먹고 튀다의 줄임말. 인터넷상에서 다른 사람의 소유 아이템을 훔치는 행위에서 비롯됨. 거액을 돈을 벌고 그만큼의 구실을 안 하고 수익만 챙겨서 떠나는 것을 말함.','그는 엄청난 몸값을 받고도 경기에는 아예 나오지 않아 먹튀 이미지로 전락했다.',to_date('2019-12-05 15:09:04','yyyy-mm-dd hh24:mi:ss'),'')
 INTO WORD VALUES('64','9','리즈시절','전성기, 왕년을 뜻하는 말로, 2000년도에 EPL에서 활약하던 리즈 유나이티드에서 비롯되었다.','원빈 얼굴은 항상 리즈시절인 것 같다.',to_date('2018-04-05 18:09:02','yyyy-mm-dd hh24:mi:ss'),'https://media2.giphy.com/media/D4IqNVLX4gi4w/200.gif?cid=765b7e61a660d5d0778d28dd6d8982ec8fad86231943a357&rid=200.gif')
 INTO WORD VALUES('65','13','씹덕','오덕후(일본어 오타쿠)보다 더 심한 사람을 5덕후에서 10덕후로 부른 데에서 파생된 말로, 주로 아이돌이 귀엽다는 의미로 쓰인다.','이 멤버는 씹덕상이다.',to_date('2018-02-03 19:09:22','yyyy-mm-dd hh24:mi:ss'),'https://media0.giphy.com/media/dJUtqIcqeyMvK/200.gif?cid=765b7e61d19099c8568559fbec07ae44cb2cde5345d900f9&rid=200.gif')
