 INTO WORD VALUES('67','14','안 생겨요','주로 애인이 생기지 않는다는 뜻을 나타낼 때 사용하는 말','머리 길러서 웨이브하면 애인 생길 거 같죠? 안생겨요. 다이어트 하면 애인 생길 거 같죠? 안생겨요.',to_date('2019-02-04 7:15:27','yyyy-mm-dd hh24:mi:ss'),'https://media0.giphy.com/media/9Y5BbDSkSTiY8/200.gif?cid=765b7e6111c6015a3a673e8d3849308d92e811a44709b927&rid=200.gif')
 INTO WORD VALUES('68','17','욜로','YOLO(You Only Live Once), 즉 당신의 인생은 한 번 뿐이라는 말로. 미래는 생각하지 않고 오늘만 산다는 말','욜로 인생. 저축따위 하지 않는다. 다 쓴다.',to_date('2019-07-02 6:09:29','yyyy-mm-dd hh24:mi:ss'),'')
 INTO WORD VALUES('69','18','진지충','진지할 필요가 없는 상황에서 과도하게 진지한 행동을 하는 사람','웃자고 한 말을 진지하게 받는 진지충이 바로 나다.',to_date('2019-10-01 4:09:22','yyyy-mm-dd hh24:mi:ss'),'')
 INTO WORD VALUES('70','4','차애','두번째로 애정하는이라는 뜻이다. 최애 다음이 차애이다. 주로 한 그룹 내에서 제일 좋아하는 연예인 뒤에 좋아하는 연예인을 말한다.','내 최애는 문빈이고, 차애가 바로 은우다.',to_date('2018-08-02 16:01:27','yyyy-mm-dd hh24:mi:ss'),'https://media2.giphy.com/media/xUPGctUP1Z50BNlEpa/200.gif?cid=765b7e6116dfeb0063f74a9a7d745aae43d80b9e4487f9ae&rid=200.gif')
 INTO WORD VALUES('71','6','철컹철컹','수갑이 흔들릴 때 나는 소리. 주로 음란물을 시청하여 경찰에 끌려가거나 할 때 사용한다.','어제 실수로 음란물 사이트에 접속해버렸지 뭐야. / 철컹철컹?',to_date('2019-03-04 8:24:27','yyyy-mm-dd hh24:mi:ss'),'https://media0.giphy.com/media/l49JBLWip9ToA9q5G/200.gif?cid=765b7e617ae9aba22dc80fdf6ee86d15a4484d05c54581ad&rid=200.gif')
 INTO WORD VALUES('72','4','탈덕','덕후 생활에서 벗어난다는 뜻이다. 주로 좋아하던 연예인이 물의를 일으키거나 사회적으로 부정적인 파장을 일으켰을 때 더 이상 그 연예인을 좋아하지 않을 때 사용한다.','내 최애가 열애설이 터졌다. 오늘부로 탈덕한다.',to_date('2019-01-01 0:01:02','yyyy-mm-dd hh24:mi:ss'),'https://media0.giphy.com/media/1ckR9eszGAtNEj37rN/200.gif?cid=765b7e619bd4b410f1c612cc91cf22ffc6d38055609d5eed&rid=200.gif')
