 INTO WORD VALUES('76','15','공구','공동 구매. 한 가지 물품을 여럿이서 같이 사서 단가를 줄일 때 사용한다.','면도기 공구 파티원 모집합니다.',to_date('2019-08-01 8:09:05','yyyy-mm-dd hh24:mi:ss'),'')
