 INTO WORD VALUES('80','6','눈새','눈치 없는 새끼의 뜻으로, 주로 눈치가 없는 사람을 지칭함.','사장님께서 쉬엄쉬엄 해라고 했다고 바로 그러면 지금 휴가를 써도 됩니까?라고 한 우리 신입... 눈새다...',to_date('2019-05-06 9:09:01','yyyy-mm-dd hh24:mi:ss'),'')
 INTO WORD VALUES('81','8','답정너','답은 정해져 있고 너는 대답만 하면 돼.의 줄임말. 원하는 답이 있을 때 확인만 하는 질문을 하는 사람을 말함.','우리 형은 답정너라 자신이 잘생겼냐고 물을 때마다 잘생겼다고 해줘야 한다.',to_date('2019-04-04 19:09:02','yyyy-mm-dd hh24:mi:ss'),'')
 INTO WORD VALUES('82','16','명존세','명치를 존나 세게 때리고 싶다의 줄임말. 사람을 매우 화나게 하는 상대, 특히 직장 상사나 밉상인 직장 동료를 일컫는다.','우리 부장...명존세야....',to_date('2019-05-01 20:09:03','yyyy-mm-dd hh24:mi:ss'),'https://media3.giphy.com/media/TEHn0Ly4cyvPBXPAjR/giphy.webp?cid=790b7611c0ab2f126186d13a81fee941de2220132dcfc49b&rid=giphy.webp')
 INTO WORD VALUES('83','15','문상','문화 상품권.','내 옆의 짝꿍이 오늘 모범상으로 문상을 받았다.',to_date('2018-05-02 14:00:02','yyyy-mm-dd hh24:mi:ss'),'https://media2.giphy.com/media/kKo2x2QSWMNfW/200.gif?cid=765b7e613b05a5e4b5f4af39dd07ea6985ccd0a93272648f&rid=200.gif')
 INTO WORD VALUES('84','16','미드','미국 드라마.','미드의 고전은 프렌즈이다.',to_date('2018-02-03 23:09:02','yyyy-mm-dd hh24:mi:ss'),'https://media2.giphy.com/media/YnBntKOgnUSBkV7bQH/200.gif?cid=765b7e61efc75c6c864997d4d406b5e9696b98aa3f45467f&rid=200.gif')
 INTO WORD VALUES('85','14','발연기','발로 연기하다.는 뜻. 연기를 정말로 더럽게 못하는 배우들이나 그 배우들이 하는 연기를 말한다.','신인 배우의 발연기에 대중들이 경악을 금치못했다.',to_date('2019-03-02 17:09:01','yyyy-mm-dd hh24:mi:ss'),'https://media3.giphy.com/media/3oEjI80DSa1grNPTDq/200.gif?cid=765b7e6111c6015a3a673e8d3849308d92e811a44709b927&rid=200.gif')
 INTO WORD VALUES('86','13','불금','불타는 금요일. 금요일에는 신나게 보내자는 의미이다. 다이나믹 듀오의 6집 Part.2의 타이틀곡인 불타는 금요일이라는 곡에서 유래되었다고도 한다.','불금을 아주 불태워 보자고!!! / 부장님 오늘 목요일이에요.',to_date('2018-09-02 18:09:09','yyyy-mm-dd hh24:mi:ss'),'https://media2.giphy.com/media/IVMjPsEExsmis/200.gif?cid=765b7e615c0af9ca31cd4f74ab643c692a49d5b97a760980&rid=200.gif')
 INTO WORD VALUES('87','7','별다줄','별걸 다 줄인다는 뜻. 쓸데없이 말을 줄이는 상황이나 과도하게 말을 줄인 단어에 사용한다.','교카충이 교통카드충전인 거 알았어? 별다줄...',to_date('2019-01-02 9:08:00','yyyy-mm-dd hh24:mi:ss'),'https://media0.giphy.com/media/26Fmj22Npt18P4Xdu/200.gif?cid=765b7e61d527827bc7a2264bad8ceac8d710af9739038c9d&rid=200.gif')
 INTO WORD VALUES('88','8','빛삭','빛의 속도로 삭제한다는 말로, 게시글이나 댓글 따위를 신속하게 삭제할 때 사용함','댓글 빛삭해도 소용없다. 이미 PDF 다 따놨다.',to_date('2019-05-02 1:03:09','yyyy-mm-dd hh24:mi:ss'),'https://media3.giphy.com/media/vohOR29F78sGk/200.webp?cid=790b7611c9817f3111afd2b1f4725b7685d21dfa5c60786b&rid=200.webp')
 INTO WORD VALUES('89','9','여병추','여기 병신 하나 추가요의 줄임말','그것도 못해...? 여병추요~',to_date('2018-04-05 15:34:29','yyyy-mm-dd hh24:mi:ss'),'https://media3.giphy.com/media/sRirXOIam0U00/200.gif?cid=765b7e6170f0238c7c03d52c420ca188929ab81c1491cbd6&rid=200.gif')
 INTO WORD VALUES('90','10','안습','안구에 습기 차다의 줄임말. 눈물이 날 것 같이 웃기거나 눈물이 날 것 같은 안타까운 상황에서 쓰인다. 연예인 지상렬 씨에 의해 시작되었다고도 한다.','님 게임 실력 진짜 안습이다....',to_date('2017-12-04 11:09:02','yyyy-mm-dd hh24:mi:ss'),'https://media0.giphy.com/media/MEJAA7cRKQdry/200.gif?cid=765b7e61e5512ded5875f34d68f9442644913cb7ef971acf&rid=200.gif')
 INTO WORD VALUES('91','16','열폭','열등감 폭발의 줄임말. 열등감에 의해 과도하게 흥분하여 비방을 하거나 질투를 하는 사람을 지칭한다.','열폭하지마 찌질아',to_date('2018-09-02 15:09:02','yyyy-mm-dd hh24:mi:ss'),'https://media1.giphy.com/media/qNtMrJTjh3jk4/200.gif?cid=765b7e613ded224bc84181ddfd437c58135be1f631a9b1c9&rid=200.gif')
 INTO WORD VALUES('92','17','존망','존나 망했다는 말. 너무나 망해서 돌이킬 수 없을 때 사용한다.','이번 시험 존망 ㅋㅋㅋㅋㅋ',to_date('2019-09-08 14:09:02','yyyy-mm-dd hh24:mi:ss'),'')
 INTO WORD VALUES('93','16','존잘','존나 잘생겼다.','와 엠버 이번 앨범 표지 봤냐? 존잘임',to_date('2019-04-09 11:11:11','yyyy-mm-dd hh24:mi:ss'),'https://media3.giphy.com/media/cl8CnikZ28t5m/200.webp?cid=790b76115e4bf1d3a800eabb01739b47749d9ee1dfd75534&rid=200.webp')
 INTO WORD VALUES('94','15','차도남','차가운 도시 남자라는 뜻. 여자는 차도녀로 쓴다. 차가워 보이는 인상을 가진 남성을 지칭한다.','이번에 소개팅한 남자 완전 차도남이더라',to_date('2018-06-04 14:14:14','yyyy-mm-dd hh24:mi:ss'),'https://media3.giphy.com/media/FdcProU9XRl7i/200.gif?cid=765b7e61e4fbf70e89d1cb578cf91546bf970a3a3229aa3f&rid=200.gif')
 INTO WORD VALUES('95','7','카공족','카페 공부족의 줄임말로, 카페에서 장시간 공부를 하는 사람들을 말한다. ','카공족을 위한 카페를 개업했습니다!!! (카페형 독서실으로 변질되었다.)',to_date('2019-08-07 4:09:09','yyyy-mm-dd hh24:mi:ss'),'')
 INTO WORD VALUES('96','6','현시창','현실은 시궁창의 줄임말. 현실의 삶이 너무나 힘들다는 말.','월급이 통장을 스쳐간다... 현시창..',to_date('2019-04-04 23:09:09','yyyy-mm-dd hh24:mi:ss'),'https://media0.giphy.com/media/1NRV43DA8VqVBFopaT/200.webp?cid=790b761116c3476c8b706c738147f73d6a852d60dcd8f67b&rid=200.webp')
 INTO WORD VALUES('97','8','피꺼솟','피가 거꾸로 솟는다는 말이다. 너무 화가나거나 흥분했을 때 사용한다.','그 사건은 아직 미결이다. 그것만 생각하면 피꺼솟이다',to_date('2019-05-05 11:09:01','yyyy-mm-dd hh24:mi:ss'),'https://media0.giphy.com/media/7VHV66bRjGRSo/giphy.webp?cid=790b76114bc14f9360c6811901b0ff1fea56b75d9f1cd7e5&rid=giphy.webp')
 INTO WORD VALUES('98','15','고나리','관리를 키보드로 실수로 잘못 쳤을 때 나오는 말, 혹은 관리의 줄임말. 주로 다른 사람에게 쓸데없는 훈계를 할 때 사용함.','친구: 야 너 옷이 그게 뭐냐ㅋㅋㅋㅋ 나: 아 고나리 좀 하지마  취존 좀',to_date('2019-04-04 14:09:00','yyyy-mm-dd hh24:mi:ss'),'')
 INTO WORD VALUES('99','13','온라인 탑골공원','2019년에 SBS가 2000년 전후에 방송한 <인기가요>를 유튜브에서 실시간 스트리밍을 한 것에서 유래된 말. 마치 노인들이 탑골공원에서 많이 만나듯이 온라인에서 옛날 사람들이 모여있다는 뜻.','온라인 탑골공원을 보니 그 때로 돌아가는 것 같구만',to_date('2019-12-04 15:09:04','yyyy-mm-dd hh24:mi:ss'),'')
 INTO WORD VALUES('100','14','혜자','낮은 가격에 비해 품질이 매우 좋은 경우. GS25의 김혜자 도시락이 가격도 싸고 질이 좋았던 데에서 비롯했다. 반대말로는 창렬이 있다.','이 패키지 완전 혜자네~',to_date('2019-12-03 14:09:23','yyyy-mm-dd hh24:mi:ss'),'')
